                       }
                    ],
                    "author_name" : "Lachlan Archibald",
                    "author_url" : "https://plus.google.com/115671446961475717459",
                    "text" : "Awesome building; many interesting and unique internal structures and rooms. There are also a number of facilities including coffee machines, rest and relaxation areas and research areas. Staff are extremely friendly and willing to answer questions and engage in conversation.",
                    "time" : 1361349581
                 },
                 {
                    "aspects" : [
                       {
                          "rating" : 3,
                          "type" : "quality"
                       }
                    ],
                    "author_name" : "Cindy Huang",
                    "author_url" : "https://plus.google.com/107550491878142658504",
                    "text" : "There are few workplaces more desirable to work in than Google. The facilities are incredible, and reflect the company&#39;s dedication to innovation, inspiration and improvement. The interior design is fun, flexible and definitely the ideal platform for employers and employees alike to foster the great ideas of tomorrow. Should the opportunity arise, I would definitely recommend everyone to seize the chance to experience Google (and get a tour through those amazing and incredibly thoughtful micro kitchens).",
                    "time" : 1361360490
                 },
                 {
                    "aspects" : [
                       {
                          "rating" : 3,
